	add("broccoli", "{\"term\":\"broccoli\", \"etymology\":{\"influencers\":[], \"languages\":[\"Welsh\", \"English\", \"Scottish Gaelic\", \"Italian\", \"Latin\"], \"text\":\"1699, Italian {{m|it|broccoli}}, plural of {{m|it|broccolo||cabbage sprout, head}}, diminutive of {{m|it|brocco||shoot, sprout}} (which is also the origin of {{m|en|brocade}}\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;), from Latin {{m|la|broccus||pointed, sharp, projecting; buck-toothed}}, possibly of Gaulish origin, related to Proto-celtic {{m|cel-pro|*brokkos||badger}} or Proto-celtic {{m|cel-pro|*brozdos||tip, point}} (compare Scottish gaelic {{m|gd|brog||pointed instrument, awl}}, Welsh {{m|cy|procio||thrust, poke}}, Old English {{m|ang|brord||point, spike}}). More at {{m|en|brochure}}, {{l/en|brad}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant, of the cabbage family, Brassicaceae; especially, the tree-shaped flower and stalk that are eaten as a vegetable\", \"priority\":1}]}, \"synonyms\":{}}");

