	add("brochure", "{\"term\":\"brochure\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"1748, from French \u0027brochure\u0027 (stitched work) from \u0027brocher\u0027 (to stitch) from Old french (842-ca. 1400) \u0027brochier\u0027 (to pierce) from \u0027broche\u0027 (awl) from from Latin Cognate to \u0027\u0027 \u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A booklet of printed informational matter, like a pamphlet, often for promotional purposes\", \"priority\":1}]}, \"synonyms\":{}}");

