	add("brodie", "{\"term\":\"brodie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Scottish habitational surname of uncertain meaning. Probably of Pictish or Gaelic origin. Some of the suggestions that have been advanced as to the meaning of the name Brodie are:*\u0026quot;ditch\u0026quot; or \u0026quot;mire\u0026quot;, from the old Irish word \u0027broth\u0027;\u0026lt;ref\u0026gt;The history of the Province of Moray : comprising the counties of Elgin and Nairn, the greater part of the County of Inverness and a portion of the County of Banff, all called the Province of Moray before there was a division into counties (1882), vol. ii, p.248-249[http://www.archive.org/details/historyofprovinc02shawuoft]\u0026lt;/ref\u0026gt;*\u0026quot;muddy place\u0026quot;, from the Scottish Gaelic|Gaelic word \u0027brothach\u0027;\u0026lt;ref name\u003d\u0026quot;ancestry.com--Brodie-name-meaning\u0026quot;\u0026gt;[http://www.ancestry.com/facts/Brodie-name-meaning.ashx Brodie Name Meaning and Origin] Retrieved on 2008-02-07\u0026lt;/ref\u0026gt;*\u0026quot;a point\u0026quot;, \u0026quot;a spot\u0026quot;, or \u0026quot;level piece of land\u0026quot;, from the Scottish Gaelic|Gaelic word \u0027Brodha\u0027;\u0026lt;ref\u0026gt;The place names of Elginshire (1905), by Donald Matheson, p.119[http://www.archive.org/details/placenamesofelgi00mathrich]\u0026lt;/ref\u0026gt; *or originated from the Pict name \u0027Brude\u0027, \u0027Bruid\u0027 or \u0027Bridei\u0027 from King Bridei of the Picts.\u0026lt;ref\u0026gt;Clans and Chiefs, p. 52, by Ian Grimble, Frederick Muller Ltd (December 8, 1980), ISBN-10: 0856341118, ISBN-13: 978-0856341113\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Brodie Country (1991), p.1, by James Brodie, Galloper press, ISBN 0 9536718 0 1 \u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;rampantscotland.com[http://www.rampantscotland.com/clans/clans_index.htm]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"transferred from the surname\", \"priority\":1}]}, \"synonyms\":{}}");

