	add("broking", "{\"term\":\"broking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The craft or profession of a broker; mediation in a sale or transaction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, K. L. James, \u0027The Internet: A User′s Guide\u0027, [http://books.google.com.au/books?id\u003dydVgKOybi6YC\u0026amp;pg\u003dPA293\u0026amp;dq\u003d%22broking%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dYm4JT4_lC8iJmQW6v4GfAg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22broking%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 293\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The order is executed automatically and the required amount is transferred to the \u0027\u0027broking\u0027\u0027 account\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Alexander Davidson, \u0027The Complete Guide to Online Stock Market Investing: The Definitive 20-Day Guide\u0027, [http://books.google.com.au/books?id\u003dsnSyRG0l5pQC\u0026amp;pg\u003dPA24\u0026amp;dq\u003d%22broking%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dYm4JT4_lC8iJmQW6v4GfAg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22broking%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 24\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"From the firm′s perspective, if the online brokerage is managed correctly, it can provide leads for the advisory or discretionary \u0027\u0027broking\u0027\u0027 service\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Sabine Go, \u0027Marine Insurance in the Netherlands 1600-1870: A Comparative Institutional Approach\u0027, [http://books.google.com.au/books?id\u003dKPihRWh7BlUC\u0026amp;pg\u003dPA72\u0026amp;dq\u003d%22broking%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dOHEJT7a_LOLnmAWt2fmIAg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22broking%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 72\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"This aversion towards \u0027\u0027broking\u0027\u0027 originated in all probability in the fear of the Amsterdam regents (\u0027regenten\u0027) that brokers might abuse their information advantage, manipulate the market in general and price levels in particular, and would thus damage the reputation of Amsterdam as a trade capital\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The action of a broker agent; exchange of messages or transactions involving a software agent\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Min Li, Xiaobo Wu, Menglian Zhao Hui Wang, Xiaolang Yan, \u0027Heterogeneous Grid Computing for Energy Constrained Mobile Device\u0027, Laurence Tianruo Yang, et al. (editors), \u0027Embedded and Ubiquitous Computing: International Conference EUC 2004, Aizu-Wakamatsu City, Japan, August 2004, Proceedings\u0027, LNCS 3207, [http://books.google.com.au/books?id\u003dC2x4p-GJocEC\u0026amp;pg\u003dPA360\u0026amp;dq\u003d%22broking%22+computer+OR+computing+OR+software+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d0XwJT8udDYXKmQXusp2RAg\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22broking%22%20computer%20OR%20computing%20OR%20software%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 360\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The UPnP architecture provides features for connectivity layer and resource layer that are defined in general grid computing architecture. Unfortunately, collective layer mechanisms, such as co-allocation, directory service, \u0027\u0027broking\u0027\u0027, work load management, community account and payment, are not defined yet\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Frédéric Magoulès, \u0027Fundamentals of Grid Computing: Theory, Algorithms and Technologies\u0027, [http://books.google.com.au/books?id\u003dDei9vpdQiHcC\u0026amp;pg\u003dPA20\u0026amp;dq\u003d%22broking%22+computer+OR+computing+OR+software+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dWnUJT9GKJIukiAecpbGvCQ\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22broking%22%20computer%20OR%20computing%20OR%20software%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 20\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Currently there are two brokers involved used by the portal: the LCG-2 broker and GTbroker. The GTbroker interact with the Globus resources to perform job submission. The static and dynamic information of grid resources are collected by GTbroker to achieve scheduling activities. The LCG-2 \u0027\u0027broking\u0027\u0027 solution is used to reach LCG-2 based grids\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Jing Dong, Raymond Paul, Liang-Jie Zhang, \u0027High Assurance Services Computing\u0027, [http://books.google.com.au/books?id\u003dRLZ8-ELqI7QC\u0026amp;pg\u003dPA175\u0026amp;dq\u003d%22broking%22+computer+OR+computing+OR+software+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEYEJT_fNFIn0mAXU-KWqAg\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse page 175\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The required interface of the value-adding service will be finally fulfilled by the provided interfaces of the transportation services, with the \u0027\u0027broking\u0027\u0027 and managing of the component objects and the architecture object\", \"priority\":20}]}, \"synonyms\":{}}");

