	add("bromide", "{\"term\":\"bromide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027bromine\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A binary compound of bromine and some other element or radical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A dose of bromide taken as a sedative\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A dull person with conventional thoughts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"My adviser at college was a \u0027\u0027bromide\u0027\u0027 who had not had an original thought in years\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027bromide\u0027\u0027 conforms to everything sanctioned by the majority, and may be depended upon to be trite, banal, and arbitrary\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A platitude\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"We hoped the speech would include reassurances, but instead it was merely one \u0027\u0027bromide\u0027\u0027 after another\", \"priority\":7}]}, \"synonyms\":{}}");

