	add("brony", "{\"term\":\"brony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|bro|pony|lang\u003den}}, coined circa 2010 on 4chan forum boards.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A (usually major) fan of the animated television series \u0027w:My Little Pony: Friendship is My Little Pony: Friendship is Magic\u0027, typically an adult male\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"issn \u003d 0024-9262 passage \u003d But Sethisto thinks that for him and his fellow \u0027\u0027bronies\u0027\u0027, the show has \u0026quot;evolved way past being just another 22-minute commercial. They gave the team enough freedom to really make it awesome.\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

