	add("bronze", "{\"term\":\"bronze\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\"], \"text\":\"1730-40; from French \u0027bronze\u0027 (1511), from Italian \u0027bronzo\u0027 (13th cent.); see it for more.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A natural or man-made alloy of copper, usually of tin, but also with one or more other metals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A reddish-brown colour, the colour of bronze\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A work of art made of bronze, especially a sculpture\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A bronze medal\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Boldness; impudence; brass\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Embrown\u0027d with native \u0027\u0027bronze\u0027\u0027, lo! Henley stands\", \"priority\":7}]}, \"synonyms\":{}}");

	add("bronzer", "{\"term\":\"bronzer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|bronze|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cosmetic product intended to give the skin a temporary bronzed colour resembling a suntan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, Mario Badescu, \u0027Mario Badescu\u0027s Skin Care Program for Men\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Bronzers\u0027\u0027, you see, contain alcohol, which can\u0027t help but be drying to the skin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Toni Stabile, \u0027Everything you want to know about cosmetics\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Some men were turning up with their faces covered with \u0026quot;\u0027\u0027bronzers\u0027\u0027\u0026quot; that made them look jaundiced, mottled terra cotta, or muddy brown\", \"priority\":5}]}, \"synonyms\":{}}");

